script: |
  super -f text -I q2560.spq | sort > q2560.out

inputs:
  - name: q2560.spq
    data: |
      SELECT - col2, col0 + - col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 63 + - col2 IN ( + - 18 * + 93 );
  - name: tab0

outputs:
  - name: q2560.out
    data: |
      -10	66
      -47	-66
      -99	96
